if mibBuilder.loadTexts: juniHdlcIfForceDteAck.setDescription('The force DTE acknowledge setting. This object is only applicable to HDLC interfaces directly over a high speed serial interface (HSSI). This is set to force Cisco compatibility mode, and is only valid when the lower interface is configured for internal (DTE) clocking. At creation, if a value for this object is not specified, a default will be chosen that is suitable for the type of lower interface on which this interface is stacked. If the lower interface is not HSSI, then the default value will be forceDteAckUnsupported(0); if the lower interface is HSSI then the default value will be forceDteAckNormal(1).')
